package com.testing.software_testing;

public class WhileLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		/*
		 * int i=10;
		 * 
		 * while (i<=150) { i++; System.out.println(i); }
		 */
		int i =75;
		while(i>=48)
		{
			i--;
			System.out.println(i);
		}
	}

}
